
DROP TABLE IF EXISTS cscart_product_warehouses_inventory;
CREATE TABLE `cscart_product_warehouses_inventory` (
  `warehouse_hash` int(11) unsigned NOT NULL DEFAULT '0',
  `warehouse_id` mediumint(8) unsigned NOT NULL,
  `product_id` mediumint(8) unsigned NOT NULL,
  `combination_hash` int(11) unsigned NOT NULL DEFAULT '0',
  `amount` mediumint(8) NOT NULL,
  PRIMARY KEY (`warehouse_hash`),
  UNIQUE KEY `warehouse_id` (`warehouse_id`,`combination_hash`,`product_id`),
  KEY `product_id` (`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

